    import { Routes, Route, Navigate } from "react-router-dom";

import Login from "../components/Page/Home/Login";
import OrderStock from "../components/Page/Order/OrderStock";
import DashboardAdmin from "../components/Page/Sidebar/admin/DashboardAdmin";
import DashboardStaff from "../components/Page/Sidebar/staff/DashboardStaff";
import DashboardLayout from "../components/Page/Home/DashboardLayout";
import UserProfile from "../components/Page/Profile/UserProfile";
import Product from "../components/Page/Product/Product";

function AppRoutes() {
  // Function to check if user is authenticated
  const isAuthenticated = () => {
    const token = localStorage.getItem('token');
    return !!token;
  };

  // Function to get user role
  const getUserRole = () => {
    const role = localStorage.getItem('role');
    return role || '';
  };

  // Protected Route Component
  const ProtectedRoute = ({ children, allowedRoles = [] }) => {
    const auth = isAuthenticated();
    const userRole = getUserRole();

    if (!auth) {
      return <Navigate to="/login" />;
    }

    if (allowedRoles.length > 0 && !allowedRoles.includes(userRole)) {
      // Redirect based on role
      if (userRole === 'admin') {
        return <Navigate to="/admin" />;
      } else if (userRole === 'staff') {
        return <Navigate to="/staff" />;
      } else {
        return <Navigate to="/login" />;
      }
    }

    return children;
  };

  return (
    <Routes>
      <Route path="/" element={<Navigate to="/login" />} />
      <Route path="/login" element={<Login />} />

      {/* Admin Routes */}
      <Route
        path="/admin"
        element={
          <ProtectedRoute allowedRoles={['admin']}>
            <DashboardLayout>
              <DashboardAdmin />
            </DashboardLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/admin/products"
        element={
          <ProtectedRoute allowedRoles={['admin']}>
            <DashboardLayout>
              <Product />
            </DashboardLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/admin/orders"
        element={
          <ProtectedRoute allowedRoles={['admin']}>
            <DashboardLayout>
              <OrderStock />
            </DashboardLayout>
          </ProtectedRoute>
        }
      />

      {/* Staff Routes */}
      <Route
        path="/staff"
        element={
          <ProtectedRoute allowedRoles={['staff']}>
            <DashboardLayout>
              <DashboardStaff />
            </DashboardLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/staff/orders"
        element={
          <ProtectedRoute allowedRoles={['staff']}>
            <DashboardLayout>
              <OrderStock />
            </DashboardLayout>
          </ProtectedRoute>
        }
      />

      {/* Shared Routes */}
      <Route
        path="/userprofile"
        element={
          <ProtectedRoute allowedRoles={['staff', 'admin']}>
            <DashboardLayout>
              <UserProfile />
            </DashboardLayout>
          </ProtectedRoute>
        }
      />

      {/* Catch-all route */}
      <Route path="*" element={<Navigate to="/login" />} />
    </Routes>
  );
}

export default AppRoutes;
